import { combineReducers, createStore } from "redux";
import {CompaniesReducer} from "./Companies/CompaniesReducer";
import { ProfileCalculationsReducer } from "./ProfileCalculations/ProfileCalculationsReducer";


const reducers = combineReducers(
    {
        Companies:CompaniesReducer,
        ProfileCalculations:ProfileCalculationsReducer
        
    }
)

//בניית הסטור- המחסן הגלובאלי- שיכיר את כל הנתונים
export const store = createStore(reducers);

//לצורך בדיקה בלבד- בדפדפן
window.store = store;
